id = "RN112"
question = "Hur förklarar William Eamon begreppet 'hemlighet' ur ett kunskapsperspektiv?"
answer = "Ett sätt var att definiera hemlighet utifrån kunskapers sociala funktion, som något som alla inte hade eller skulle ha tillgång till och därför var något som motiverade sociala gränsdragningar. Ett annat sätt var att definiera begreppet utifrån en epistemologisk funktion, som något av Gud skapat och av mänskligheten oupptäckt"
